      onEnterForeground: function onEnterForeground() {
        this._super();
        if (this.lastEnterBackGroundTime) {
          var backgroundTime = new Date().getTime() - this.lastEnterBackGroundTime;
          if (backgroundTime > 3e5) {
            IAds.showInterstitialAd("Ad_LobbyFromBackground");
            performWithDelay(this.node, 1, handler(this, this.delayLoadBackgroundAd));
          }
          this.lastEnterBackGroundTime = 0;
        }
        if (this.gameCore) {
          this.gameCore.gameMng.lobbyIdleTime = LOBBY_IDLE_AD_TIME;
          cc.sys.isNative && (this.spadesBtn.node.active = !this.gameCore.gameMng.checkAppInstalled("com.games.poker.spades"));
        }
        if (cc.sys.localStorage.getItem("HotFix_Remote_Version")) return;
        var strUrl = cc.sys.localStorage.getItem("HotFix_Version_Url");
        if (!strUrl || strUrl.length < 1) return;
        var xhr = cc.loader.getXMLHttpRequest();
        xhr.onreadystatechange = function() {
          if (4 != xhr.readyState) return;
          if (xhr.status < 200 && xhr.status >= 300) return;
          LogUtil.debug(TAG, "Hot Fix Version Download Succ \uff1a" + xhr.responseText);
          var objRes = null;
          try {
            objRes = JSON.parse(xhr.responseText);
          } catch (error) {
            LogUtil.err(TAG, "There is error parse on Hot Fix Remote Versoion");
            return;
          }
          cc.sys.localStorage.setItem("HotFix_Remote_Version", objRes.version);
        };
        xhr.open("GET", strUrl, true);
        xhr.timeout = 15e3;
        var a = xhr.send();
      },
