      trainingUserDeclareWin: function trainingUserDeclareWin(result, score, group) {
        if (!ITeenPatti.getCurRoom()) return;
        this.score = score;
        this.scoreAfterLayoff = score;
        this.group = group;
        this.isSelfWin = true;
        this.roomStatus = RUMMY_ROOM_STATE.WAIT_FOR_OTHER_DECLARE;
        var objData = {};
        objData.playerId = 1;
        objData.result = result;
        objData.roundId = this.roundId;
        objData.roundID = this.roundId;
        objData.num = score;
        this.table.contrller.onUserDeclarewin("rummydeclarewin", objData);
        for (var i = 0; i < this.aiHandCardList.length; i++) this.cardList.push(this.aiHandCardList.pop());
        this.getAILoseCardGroup();
        if (this.isSelfWin) {
          var cardBar = this.table.contrller.centerSeat.cardBar.getComponent("GinRummyCardBar");
          var aiScore = cardBar.caculateScore(this.aiHandCardList, this.aiGroupCardIndex);
          this.aiDeclare(aiScore);
        } else {
          this.score = 80;
          this.scoreAfterLayoff = 80;
          this.aiScore = -80;
          this.aiScoreAfterLayoff = -80;
          this.unscheduleAllCallbacks();
          this.scheduleOnce(this.trainingRoundFinish, .2);
        }
      },
      getAILoseCardGroup: function getAILoseCardGroup() {
        this.rummyAIMng.getLoseCardGroup(this.turnCount);
        this.aiHandCardList = [];
        this.aiGroupCardIndex = [];
        LogUtil.debug(TAG, "\u751f\u6210AI\u5728\u7b2c" + this.turnCount + "\u8f6e\u8f93\u7684\u624b\u724c:");
        for (var i = 0; i < this.rummyAIMng.winCardGroup.length; i++) {
          LogUtil.debug(TAG, "\u7b2c" + i + "\u7ec4:" + CardUtils.changeCardList2String(this.rummyAIMng.winCardGroup[i].cards) + " (" + this.rummyAIMng.winCardGroup[i].type + ")");
          var style = 3;
          var gcolor = 1;
          if (this.rummyAIMng.winCardGroup[i].type == GROUP_TYPE.SEPARATE) {
            style = 4;
            gcolor = 3;
          }
          var cardGroup = {
            begin: 0,
            end: 0,
            style: style,
            gcolor: gcolor,
            text: ""
          };
          cardGroup.begin = this.aiHandCardList.length;
          for (var j = 0; j < this.rummyAIMng.winCardGroup[i].cards.length; j++) this.aiHandCardList.push(this.rummyAIMng.winCardGroup[i].cards[j]);
          cardGroup.end = this.aiHandCardList.length - 1;
          this.aiGroupCardIndex.push(cardGroup);
        }
      },
      trainingUserDeclare: function trainingUserDeclare(score, group) {
        if (!ITeenPatti.getCurRoom()) return;
        this.score = score;
        this.scoreAfterLayoff = score;
        this.group = group;
        var objData = {};
        objData.playerId = 1;
        objData.roundId = this.roundId;
        objData.roundID = this.roundId;
        objData.num = score;
        this.layoffs = [];
        if (this.table.contrller.winnerPoint > 0) {
          var cardBar = this.table.contrller.centerSeat.cardBar.getComponent("GinRummyCardBar");
          var cACI = cardBar.cloneArrCardId(cardBar.arrCardID);
          var cGCI = cardBar.cloneGroupCardIndex(cardBar.groupCardIndex);
          var scatterCards = [];
          for (var i = 0; i < cGCI.length; i++) if (cGCI[i].style == cardBar.SeqType.Scatter) {
            var cards = this.getCardsByGroup(cGCI[i], cACI);
            scatterCards = scatterCards.concat(cards);
          }
          var winnerACI = cardBar.cloneArrCardId(this.aiHandCardList);
          var winnerGCI = cardBar.cloneGroupCardIndex(this.aiGroupCardIndex);
          var canLayOffCards = GinRummyUtil.autoLayOff(winnerACI, winnerGCI, scatterCards);
          for (var i = 0; i < canLayOffCards.length; i++) cardBar.deleteOneCardFromCards(cACI, cGCI, cACI.indexOf(canLayOffCards[i]));
          this.layoffs = [ {
            playerId: 1,
            groupIdx: 1,
            cards: {}
          } ];
          for (var i = 0; i < canLayOffCards.length; i++) this.layoffs[0].cards[i + 1] = canLayOffCards[i];
          this.layoffs[0].cards = GinRummyUtil.changeCardsToServer(this.layoffs[0].cards);
          score = cardBar.caculateScore(cACI, cGCI);
          this.scoreAfterLayoff = score;
        }
        this.table.contrller.onUserDeclare("rummydeclare", objData);
        this.roomStatus = RUMMY_ROOM_STATE.END;
        this.unscheduleAllCallbacks();
        this.scheduleOnce(this.trainingRoundFinish, .2);
      },
      trainingRoundFinish: function trainingRoundFinish() {
        if (!ITeenPatti.getCurRoom()) return;
        this.roomStatus = RUMMY_ROOM_STATE.END;
        var objData = {};
        objData.roundId = this.roundId;
        objData.roundID = this.roundId;
        objData.isDraw = this.isDraw;
        this.table.onRoundFinish("rummyfinish", objData);
        this.table.contrller.onRoundFinish("rummyfinish", objData);
        this.isDraw ? this.trainingShowIntegralDraw() : this.trainingShowIntegral();
        if (0 == this.hasWinner) {
          this.unscheduleAllCallbacks();
          this.needStartNew = true;
        }
      },
      trainingCloseResultView: function trainingCloseResultView() {
        if (this.needStartNew) {
          this.needStartNew = false;
          this.scheduleOnce(this.trainingRoundReady, .5);
        }
      },
