      trainingShowIntegral: function trainingShowIntegral() {
        if (!ITeenPatti.getCurRoom()) return;
        this.hasWinner = 0;
        var cardBar = this.table.contrller.centerSeat.cardBar.getComponent("GinRummyCardBar");
        this.aiGroup = cardBar.makeGroupToProtoObj(this.aiHandCardList, this.aiGroupCardIndex);
        var objData = {};
        var integral = {};
        integral.playerId = 1;
        integral.num = this.score;
        integral.group = this.group;
        integral.userId = ITeenPatti.getCurPlayer().userId;
        integral.undercut = 0;
        integral.gin = 0;
        var integralAI = {};
        integralAI.playerId = 2;
        integralAI.num = this.aiScore;
        integralAI.group = this.aiGroup;
        integralAI.userId = 2;
        integralAI.undercut = 0;
        integralAI.gin = 0;
        this.isSelfToWin ? integralAI.layoffs = this.layoffs : integral.layoffs = this.layoffs;
        this.layoffs = null;
        if (this.isSelfWin) if (0 == this.scoreAfterLayoff) {
          integral.roundscore = this.aiScoreAfterLayoff - this.scoreAfterLayoff;
          integral.roundscore += 25;
          integral.gin = 25;
          integralAI.roundscore = 0;
          var ginNum = ITeenPatti.player.tpProfile.trainingGinNum + 1;
          ITeenPatti.player.tpProfile.trainingGinNum = ginNum;
          LocalStorage.saveLocalData(LocalStorage.keys.TRAINING_GIN_NUM, ginNum);
        } else {
          var knockNum = ITeenPatti.player.tpProfile.trainingKnockNum + 1;
          ITeenPatti.player.tpProfile.trainingKnockNum = knockNum;
          LocalStorage.saveLocalData(LocalStorage.keys.TRAINING_KNOCK_NUM, knockNum);
          if (this.aiScoreAfterLayoff <= this.scoreAfterLayoff) {
            integralAI.roundscore = this.scoreAfterLayoff - this.aiScoreAfterLayoff + 25;
            integralAI.undercut = 25;
            integral.roundscore = 0;
          } else {
            integral.roundscore = this.aiScoreAfterLayoff - this.scoreAfterLayoff;
            integralAI.roundscore = 0;
          }
        } else if (0 == this.aiScoreAfterLayoff) {
          integralAI.roundscore = this.scoreAfterLayoff - this.aiScoreAfterLayoff;
          integralAI.roundscore += 25;
          integralAI.gin = 25;
          integral.roundscore = 0;
        } else if (this.scoreAfterLayoff <= this.aiScoreAfterLayoff) {
          integral.roundscore = this.aiScoreAfterLayoff - this.scoreAfterLayoff + 25;
          integral.undercut = 25;
          integralAI.roundscore = 0;
          var undercutNum = ITeenPatti.player.tpProfile.trainingUndercutNum + 1;
          ITeenPatti.player.tpProfile.trainingUndercutNum = undercutNum;
          LocalStorage.saveLocalData(LocalStorage.keys.TRAINING_UNDERCUT_NUM, undercutNum);
        } else {
          integralAI.roundscore = this.scoreAfterLayoff - this.aiScoreAfterLayoff;
          integral.roundscore = 0;
        }
        if (this.isSelfWin) {
          objData.results = {
            1: integralAI,
            2: integral
          };
          objData.knockId = 1;
        } else {
          objData.results = {
            1: integral,
            2: integralAI
          };
          objData.knockId = 2;
        }
        ITeenPatti.getCurPlayer().tpProfile.ginPoints += integral.roundscore;
        integral.finalscore = ITeenPatti.getCurPlayer().tpProfile.ginPoints;
        var tpUser = this.table.getUserWithUserID(integralAI.userId);
        if (tpUser) {
          tpUser.tpProfile.ginPoints += integralAI.roundscore;
          integralAI.finalscore = tpUser.tpProfile.ginPoints;
        }
        integral.roundscore > 0 ? ITeenPatti.gameCore.dataAnalysisMng.sendData(DataAnalysisKey.WIN_GAME_TRAINING) : ITeenPatti.gameCore.dataAnalysisMng.sendData(DataAnalysisKey.LOSE_GAME_TRAINING);
        ITeenPatti.getCurPlayer().tpProfile.ginPoints >= this.winPoint ? this.hasWinner = 1 : tpUser && tpUser.tpProfile.ginPoints >= this.winPoint && (this.hasWinner = 2);
        objData.roundId = this.roundId;
        objData.roundID = this.roundId;
        this.table.onUserShowIntegral("rummyshowintegral", objData);
        var gameScene = cc.director.getScene().getChildByName("Canvas").getComponent("GinRummyScene");
        gameScene.onGinRoundFinish("rummyshowintegral", objData);
        if (this.hasWinner > 0) {
          this.unschedule(this.trainingGinGameFinish);
          this.scheduleOnce(this.trainingGinGameFinish, 3);
        }
      },
